    "2015-09-26T19:55:55.210735",nt"name": "2012-2013-puget-sound-lidar-consortium-pslc-topographic-lidar-hoh-river-watershed-washington-de",nt"isopen":
    false,nt"url": null,nt"notes": "Watershed Sciences, Inc. (WSI) collected
    Light Detection and Ranging (LiDAR) data on the Hoh River watershed survey area
    for the Puget Sound LiDAR Consortium and the Hoh Tribe Department of Natural Resources.
    This data set covers approximately 270 square miles. Due to spring snow on the ground
    WSI was unable to acquire data for the complete survey during the initial flights
    in April and returned to finish the collection at a later date. Delivery 1 of the
    survey area was collected on April 14th, 15th, 17th, 19th, 20th and 21st. Delivery
    2 was collected between April 14th, 2012 and July 24th, 2013. Each delivery was
    processed by NOAA OCM separately using identical methods. See processing steps below
    for additional information. The LiDAR survey utilized both a Leica ALS60 and a Leica
    ALS50-II sensor in a Cessna Caravan 208B.All areas were surveyed with an opposing
    flight line side-lap of =60% (=100% overlap) to reduce laser shadowing and increase
    surface laser painting. The Leica laser systems allow up to four range measurements
    (returns) per pulse, and all discernible laser returns were processed for the output
    dataset. This Lidar survey for Deliveries 1 and 2 achieved a point density of 9.54
    points per square meter.",nt"license_title": null,nt"extras": [{ntt"key":
